import React from 'react';
import { Cards } from './Cards';
import { Data } from './Array_data';

function App1() {
    
    return (<>

        {Data.map((val) => {

            return (

                <Cards
            keys={val.id}
            imgsrc={val.imgsrc}
            title={val.title}
            sname={val.sname}
            link={val.link} />
                
            );
        })}


    </>);
}

export { App1 };
